#define SRT_NX90MPW_idpm_irq_raw_firmware 2

/* all used bits of 'NX90MPW_idpm_irq_raw': */
#define MSK_USED_BITS_NX90MPW_idpm_irq_raw 0x00000005

/* --------------------------------------------------------------------- */
/* Register idpm_irq_host_mask_set */
