/*    0x29   en_in                    input,                      HIF pio input sampling enable */
/*    0x2a   eth_mmio_mdc             always driven output,       MDIO */
/*    0x2b   eth_mmio_mdio            bidirectional,              MDIO */
/*    0x3f   PIO mode                 use MMIO PIO line registers PIO function} */
/* => Mode: R/W */
